// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CreditTransfer {
    struct Student {
        string name;
        uint age;
        string email;
        address walletAddress;
        string abcId;
        string password;
    }

    struct Institute {
        string name;
        string location;
        address walletAddress;
        mapping(address => bool) verifiedThirdParties; // Mapping to store verified third-party addresses
        address[] enrolledStudents; // Array to store enrolled students
        string password;
    }

    struct Marksheet {
        address institute;
        address student;
        uint semesterNumber;
        string content;
        bool creditsGiven; // New field to track credits
    }


    struct SemesterCompletion {
        address student;
        uint semesterNumber;
        uint completionTimestamp;
        bool verified;
    }

    mapping(address => Institute) public institutes; // Mapping to store Institute details
    mapping(address => Student) public students; // Mapping to store Student details
    mapping(address => address) public studentInstitute; // Mapping to store student's current institute
    mapping(address => string) public studentABCIds; // Mapping to store ABC ID of students
    mapping(address => uint) public studentCredits; // Mapping to store credits for each student
    mapping(uint => Marksheet) public markSheets;

    event SemesterCompleted(address indexed student, uint semesterNumber, uint completionTimestamp, bool verified);
    event MarksheetSubmitted(address indexed institute, address indexed student, uint semesterNumber, string content);
    event AdminApproval(uint semesterNumber, address indexed student);
    event TransferCredits(address indexed student, uint credits);
    event ThirdPartyVerified(address indexed institute, address indexed thirdParty);

    uint public minCreditsRequiredForTransfer = 60; // Minimum credits required for transfer
    address[] public instituteAddresses; // Array to store institute addresses
    address[] public studentAddresses;
    address public owner;

    constructor() {
        owner = msg.sender; // Set the contract creator as the owner
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only contract owner can call this function");
        _; // Continue execution if the caller is the owner
    }


    function setMinCreditsRequiredForTransfer(uint _minCredits) public {
        minCreditsRequiredForTransfer = _minCredits;
    }

    function setStudentDetails(address _student, string memory _name, uint _age, string memory _email, string memory _abcId, string memory _password) public {
        students[_student] = Student(_name, _age, _email, _student, _abcId, _password);
        studentAddresses.push(_student);
    }

    function setInstituteDetails(address _institute, string memory _name, string memory _location, string memory _password) public {
        require(institutes[_institute].walletAddress == address(0), "Institute already registered");

        Institute storage newInstitute = institutes[_institute];
        newInstitute.name = _name;
        newInstitute.location = _location;
        newInstitute.walletAddress = _institute;
        newInstitute.password = _password;
        instituteAddresses.push(_institute); // Add new institute address to array
    }

    function getInstituteCount() public view returns (uint) {
        return instituteAddresses.length;
    }

    function getInstituteAddresses() public view returns (address[] memory) {
        return instituteAddresses;
    }

    function getStudentAddresses() public view returns (address[] memory) {
        return studentAddresses;
    }

    function enrollStudent(address _institute, address _student) public {
        require(students[_student].walletAddress != address(0), "Student not registered");

        Institute storage institute = institutes[_institute];
        institute.enrolledStudents.push(_student);
        studentInstitute[_student] = _institute;
    }

    function getEnrolledStudents(address _institute) public view returns (address[] memory) {
        Institute storage institute = institutes[_institute];
        return institute.enrolledStudents;
    }

    function addVerifiedThirdParty(address _institute, address _thirdParty) public {
        require(institutes[_institute].walletAddress == msg.sender, "Only institute can add third-party");
        require(!institutes[_institute].verifiedThirdParties[_thirdParty], "Third-party already verified");

        institutes[_institute].verifiedThirdParties[_thirdParty] = true;
        emit ThirdPartyVerified(_institute, _thirdParty);
    }



    function giveCredits(address _student, uint _credits) public onlyOwner {
        require(_credits > 0, "Invalid credits amount");
        studentCredits[_student] += _credits;
        emit TransferCredits(_student, _credits);
    }

    // Function to transfer ownership (in case needed)
    function transferOwnership(address newOwner) public onlyOwner {
        owner = newOwner;
    }


    function getLatestSubmittedSemester(address _student) internal view returns (uint) {
        uint latestSemester = 0;
        for (uint i = 1; i <= 8; i++) {
            if (markSheets[i].student == _student && markSheets[i].institute != address(0)) {
                latestSemester = i;
            }
        }
        return latestSemester;
    }

    function submitMarksheet(uint _semesterNumber, string memory _content, address _student) public {
        address instituteAddress = msg.sender;
        address enrolledInstitute = studentInstitute[_student];

        require(instituteAddress == enrolledInstitute, "Caller is not authorized to submit marksheet for this student");
        require(_semesterNumber >= 1 && _semesterNumber <= 8, "Invalid semester number");

        markSheets[_semesterNumber] = Marksheet(instituteAddress, _student, _semesterNumber, _content, false);

        emit MarksheetSubmitted(instituteAddress, _student, _semesterNumber, _content);
    }

    function getMarksheet(uint _semesterNumber) public view returns (address, address, string memory, bool) {
        Marksheet memory marksheet = markSheets[_semesterNumber];

        return (marksheet.institute, marksheet.student, marksheet.content, marksheet.creditsGiven);
    }

    function creditsGivenForMarksheet(uint _semesterNumber) public view returns (bool) {
        Marksheet memory marksheet = markSheets[_semesterNumber];

        return marksheet.creditsGiven;
    }


    function transferInstitute(address _newInstitute) public {
        address studentAddress = msg.sender;
        uint totalCredits = studentCredits[studentAddress];
        
        require(totalCredits >= minCreditsRequiredForTransfer, "Insufficient credits for transfer");
        require(studentInstitute[studentAddress] != _newInstitute, "Already enrolled in the new institute");

        studentInstitute[studentAddress] = _newInstitute;

        studentCredits[studentAddress] -= totalCredits; // Deduct credits upon transfer
        emit TransferCredits(studentAddress, totalCredits); // Emit an event indicating the transfer of credits
    }

    function getTotalCredits(address _student) public view returns (uint) {
        return studentCredits[_student];
    }

    function studentLogin(address _student, string memory _password) public view returns (bool) {
        return keccak256(abi.encodePacked(students[_student].password)) == keccak256(abi.encodePacked(_password));
    }

    function instituteLogin(address _institute, string memory _password) public view returns (bool) {
        return keccak256(abi.encodePacked(institutes[_institute].password)) == keccak256(abi.encodePacked(_password));
    }
}
